import React from 'react'
import { Card, Col, Container, Row } from 'react-bootstrap';

const ObjectChildrenComponent = () => {
  return (
    <div>
      <Container>
        <Row>
         <ProductItems/>
        </Row>
      </Container>
    </div>
  )
}

export default ObjectChildrenComponent;

function ProductItems() {
    return (
        <Col lg="3" md="6">
       <Card>
        <Card.Body>
            <Card.Title>Course 1</Card.Title>
            <Card.Text>
                
            </Card.Text>
        </Card.Body>
       </Card>
        </Col>
    )
}
